import React from "react";
import { Link } from "react-router-dom";
import Button from 'react-bootstrap';
import Card from "react-bootstrap/Card";



function Cards() {
  return (
    <Card style={{ width: "18rem" }}>
      <Card.Img variant="top" src="novice.png" />
      <Card.Body>
        <Card.Title>Novice</Card.Title>
        <Card.Text>
          Nosedive into the world of Computing with our entry level products.
        </Card.Text>
         <Button Link to = '/novice' variant="success">Success</Button>
      </Card.Body>
    </Card>
  );
}

export default Cards;
